chop $DATA;

our @EXPORT = qw(
  unicode_age_n
  unicode_age_c
);

use Carp;
sub import ($;@) {
  my $from_class = shift;
  my ($to_class, $file, $line) = caller;
  no strict 'refs';
  for (@_ ? @_ : @{$from_class . '::EXPORT'}) {
