no warnings 'uninitialized';
no warnings 'substr';

sub unicode_age_n ($) {
  return $VALUE->[(unpack 'C', (substr $DATA, $_[0], 1 or "\x40")) - 0x40];
} # unicode_age_n

sub unicode_age_c ($) {
  return $VALUE->[(unpack 'C', (substr $DATA, ord $_[0], 1 or "\x40")) - 0x40];
} # unicode_age_c

