=head1 NAME

Char::Prop::Unicode::Age - Unicode 8.0.0 Age property

=head1 SYNOPSIS

  use Char::Prop::Unicode::Age;
  
  warn unicode_age_n 0x4E00;
  warn unicode_age_c "\x{4E00}";

=head1 DESCRIPTION

The C<Char::Prop::Unicode::Age> module exports two
functions, C<unicode_age_n> and
C<unicode_age_c>, both return the value of Unicode
8.0.0 Age property for the specified
character (or code position).  C<unicode_age_n>
accepts a number representing the code position, while
C<unicode_age_c> expects a (utf8-flagged) character,
as the first and only argument.

=head1 UNICODE VERSION

This module supports Unicode 8.0.0.



This module is expected to be updated once a newer version of Unicode
is released.



